# ****************************************************************
# CAUTION: ANY CHANGES TO DEFAULT APPLIES TO ALL SECTIONS
#          IF NOT OVERWRITTEN LOCALLY
# ****************************************************************
# Usage:
# [package name]
# name =        # name of the package
# pattern     = # pattern to match packages. would be used
#               # packager to pick packages from given directory
# verifylist =  # list of details to be verified in a package to
#               # consider as acceptable package
# location =    # location where the package file is available
# release =     # package release
# version =     # package version
# arch    =     # architecture of the package
# filename =    # package file name
#
# *****************************************************************

[DEFAULT]
name       = %(__name__)s
pattern    = {pkg}-[0-9]*.rpm
verifylist = RELEASE, VERSION, ARCH, NAME
location   = /cs-shared/builder/cache/

